const void* ImGuiAl::Fonts::GetCompressedData( Font font, int* size )
{
  const void* compressed_ttf_data;
  int compressed_ttf_size;
  
  switch ( font )
  {
#ifdef IMGUIAL_FONTS_COUSINE_REGULAR
  case kCousineRegular:
    compressed_ttf_data = cousine_compressed_data;
    compressed_ttf_size = cousine_compressed_size;
    break;
#endif
#ifdef IMGUIAL_FONTS_DROID_SANS
  case kDroidSans:
    compressed_ttf_data = droid_compressed_data;
    compressed_ttf_size = droid_compressed_size;
    break;
#endif
#ifdef IMGUIAL_FONTS_KARLA_REGULAR
  case kKarlaRegular:
    compressed_ttf_data = karla_compressed_data;
    compressed_ttf_size = karla_compressed_size;
    break;
#endif
#ifdef IMGUIAL_FONTS_PROGGY_TINY
  case kProggyTiny:
    compressed_ttf_data = proggy_compressed_data;
    compressed_ttf_size = proggy_compressed_size;
    break;
#endif
#ifdef IMGUIAL_FONTS_FONT_AWESOME
  case kFontAwesome:
    compressed_ttf_data = awesome_compressed_data;
    compressed_ttf_size = awesome_compressed_size;
    break;
#endif
#ifdef IMGUIAL_FONTS_MATERIAL_DESIGN
  case kMaterialDesign:
    compressed_ttf_data = mdi_compressed_data;
    compressed_ttf_size = mdi_compressed_size;
    break;
#endif
#ifdef IMGUIAL_FONTS_KENNEY_ICONS
  case kKenneyIcons:
    compressed_ttf_data = kenney_compressed_data;
    compressed_ttf_size = kenney_compressed_size;
    break;
#endif
  default:
    compressed_ttf_data = NULL;
    compressed_ttf_size = 0;
    break;
  }
  
  *size = compressed_ttf_size;
  return compressed_ttf_data;
}
